import React from 'react';
import './style.css';
import BG from '../../image/spkt.jpg';
import { Link} from "react-router-dom";

HomeFeature.propTypes = {
    
};

function HomeFeature(props) {
    return (
      <div>
        <div className='login-form'>
          <div className='login-form greeting'>
            <p>Chào mừng đến với<br/>UTECLUBS</p>
          </div>
          <div className='login-form main-board'>
            <div className='background'>
              <img src={BG}/>
            </div>
            <div className='login'>
              <p>Đăng nhập để tiếp tục</p><br/>
              <Link className='login-link' to='/login'>ĐĂNG NHẬP</Link>
            </div>
          </div>
        </div>
      </div>
    );
}

export default HomeFeature;
